const TopRated = () => {

    const [topRated, setTopRated] = useState([])

    useEffect(() => {
        fetch("https://api.themoviedb.org/3/movie/?api_key=41514cf9c5004dbe47144dbf1928e39c")
            .then(res => res.json())
            .then(data => setTopRated(data.result))

    }, [])


    console.log(topRated)
    return (
        <div>
            <h1>toprated</h1>
        </div>
    )
}

